CREATE TABLE public.users (
id serial4 NOT NULL,
role_id int8 NOT NULL,
branch_id int8 NOT NULL default 1,
'name' varchar(191) NOT NULL,
email varchar(191) NOT NULL,
email_verified_at varchar(191) NULL,
'password' varchar(191) NOT NULL,
